            <div className="line line-2"></div>
          </div>
        </div>
      </div>
      <div className="circle-container circle-container-3">
        <div className="outer-circle">
          <div className="inner-circle">
            <img src={charlizard} alt="" />
          </div>
          <div className="lines">
            <div className="line line-1"></div>
            <div className="line line-2"></div>
          </div>
        </div>
      </div> */}
    </>
  );
}
